import axios from 'axios';
// this example code
const res = await axios.get("https://www.velyn.mom/api/ai", {
  headers: { Authorization: "Bearer YOUR_API_KEY" }
});3. Install & ConnectIntegrate VelynAPI into your project using Python (requests).pythonpip install requests

import requests

API_KEY = "YOUR_API_KEY"
BASE_URL = "https://www.velyn.mom/api/ai"
headers = {
    "Authorization": f"Bearer {API_KEY}",
    "Content-Type": "application/json"
}

# --- GET Request Example ---
response = requests.get(BASE_URL, headers=headers)

if response.status_code == 200:
    print("GET Response:", response.json())
else:
    print(f"GET Error: {response.status_code}", response.text)


# --- POST Request Example ---
payload = {
    "prompt": "Hello VelynAI, introduce yourself!"
}

response = requests.post(BASE_URL, headers=headers, json=payload)

if response.status_code == 200:
    print("POST Response:", response.json())
else:
    print(f"POST Error: {response.status_code}", response.text)4. Make Your First RequestSend a request to the AI endpoint and get instant results.bashcurl -X POST https://www.velyn.mom/api/ai/velyn-1.0-1b \
